    var width = 960, height = 550;
    var radius = 3.5, strokewidth = 0.8;

    var projection = d3.geo.mercator()
      .center([0, 35 ]) .scale(150);

	var canvas = d3.select("body")
        .append("center")
        .append("svg")
        .attr("width", width)
        .attr("height", height)
        .append("g")   ;

    var path = d3.geo.path().projection(projection);

    var translate = [0,0];
    var scale = 1;
    var zoom_function = function() {
        canvas.selectAll("path")
                 .attr("transform","translate("+translate.join(",")+")scale("+scale+")");

        canvas.selectAll("circle.origin")
                 .attr("transform","translate("+translate.join(",")+")scale("+scale+")")
                 .attr("r", function(d) { return radius/scale; });
    };
    var zoom = d3.behavior.zoom().scaleExtent([1,6])
            .on("zoom",function() {
                translate = d3.event.translate;
                scale = d3.event.scale;
                zoom_function();
            });
     canvas.call(zoom)

  // adding rect for zoom (not point-disabled in css)

     canvas.append("rect")
      		   .attr("x", 0)
			   .attr("y", 0 )
			   .attr("width", width)
			   .attr("height", height)
			   .attr("fill", "white" )
			   .attr("opacity", 0  )
			    ;

   // load data and display the World


      canvas.selectAll("path")
            .data(data.features)
              .enter()
              .append("path")
              .attr("d", path)
              .attr("stroke", "none")
              .attr("fill", "lightblue" )
              .style("opacity", 0.4)

              .attr("cx", 20 ) .attr("cy", 480 )

              .attr("x", 30 ) .attr("y", 480 )
              .attr("dy", ".35em")

			  .on("click", function(d)  {

                     d3.csv("./World_files/places_q.csv", function(error, origin) {

                        canvas.selectAll("circle.origin")

						.data(origin)
                        .enter()

						.append("circle")

                        .attr("cx", function(d) {return projection([d.originlong, d.originlat])[0];})
                        .attr("cy", function(d) {return projection([d.originlong, d.originlat])[1];})
                        .attr("r", 2)
                        .style("fill", "red")
                        .style("opacity", 0.5)
                        .attr("class", "origin");
                        zoom_function();

                                });

                });



            canvas.append("text")
              .text("remove")
              .attr("x", 30 )
              .attr("y", 520)

              .attr("dy", ".35em")
              .on("click", function(d)  {
